  const [votedData, setVotedData] = useState([]);
  useEffect(() => {
    CountVote().then((data) => {
      setVotedData(data);
    });
  }, []);

  const [categoryData, setcategoryData] = useState();
  useEffect(() => {
    GetCategory().then((data) => {
      setcategoryData(data);
    });
  }, []);

  console.log(votedData);
  console.log(categoryData);
